content:
3.5단자 기준

얘는 한술 더 떠서 E5000보다 볼륨확보 더 안됨; 얘가 E5000보다 임피가 좀더 낮은듯?

저음은 벙벙대고 보컬은 미국 가버렸고 그야말로 총체적 난국이다 ;;

짱박아둔 4.4 커케 꺼내서 연결해 봐야할듯...

이걸로 확실하게 말할 수 있는데 저임피 저감도 리시버 있으면 절대 3.5단자 연결하지 마라 ;

4.4 연결해야 들을만해짐

3.5단자 기준 풀볼륨 때려도 볼륨확보 제대로 안됨 ;

거기에 앰프에 부하까지 오는지 소리 표현이 별로다...

얘도 4.4단자 필수인듯

B1까지 마저 들어봐야 알겠지만 KA3에 저임피 저감도 이어폰은 상극인듯 하다 ;

예산은 20만원 이내 (관세 내) 배대지 할줄 몰라서 직배밖에 모르는데

일단 모델명만 알려주십쇼 하루종일 뒤져보게 ㅇㅇ;

운동이나 도서관, 카페에서 쓸 예정인데 저와 비슷한 얼큰이형님들 추천 부탁합니다

예산은 20만원 이내 (관세 내) 배대지 할줄 몰라서 직배밖에 모르는데

일단 모델명만 알려주십쇼 하루종일 뒤져보게 ㅇㅇ;

운동이나 도서관, 카페에서 쓸 예정인데 저와 비슷한 얼큰이형님들 추천 부탁합니다

4.4단자로 교체하고 들었다 ;

3.5로 들을때는 뭔가 소리가 답답한 느낌이었는데

이제야 소리에 힘이 붙고 볼륨도 충분히 확보된다

14.8옴 정말 강려크하다

3.5 단자로 정 듣고싶으면 무저항잭 물려라. 그럼 좀 나음 ;


