3.5단자 연결하고 바이브 재생중...

임마 이거 머고...

볼륨 이빠이 땡겨야 들을만한 소리가 나오네 ;

소리는 꽤나 따땃한게 뜨웰브 느낌도 나네잉 ;

암튼 타임리스 승


